import React from 'react';
import styled from 'styled-components';
import Header from './components/Header';
import SubHeader from './components/SubHeader';
import Rectangle43 from "./Rectangle43.png";

const DeliveryPageContainer = styled.div`
    background-color: #1A1A1A;
    color: #F0F0F0;
    font-family: Montserrat, sans-serif;
`;

const DeliveryPageTitle = styled.h1`
    font-family: Montserrat, sans-serif;
    font-weight: 400;
    font-size: 64px;
    margin-bottom: 20px;
    text-align: center;
    color: #FFFFFF;
`;

const DeliveryPageContent = styled.div`
    max-width: 70%;
    margin: 0 auto;
    padding: 20px;
`;

const ImageContainer = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    margin-bottom: 20px;
`;

const Image = styled.img`
    width: 600px;
    height: 699px;
    border-radius: 55px;
    box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
`;

const Text = styled.p`
    font-family: Montserrat, sans-serif;
    font-weight: 300;
    font-size: 48px;
    color: #F0F0F0;
    text-align: center;
`;

const DeliveryPage = () => {
    return (
        <DeliveryPageContainer>
            <Header />
            <SubHeader />
            <DeliveryPageContent>
                <DeliveryPageTitle>Как мы работаем с клиентами</DeliveryPageTitle>
                <ImageContainer>
                    <Image src={Rectangle43} />
                    <Text>
                        Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim.
                    </Text>
                </ImageContainer>
            </DeliveryPageContent>
        </DeliveryPageContainer>
    );
};

export default DeliveryPage;
